	(12, -8, '', 12, 0, 0, '', '', 'secret,mail', '반영구화장학원', '강남 센스동안외과에서 운영하는\r\n센스반영구아카데미 입니다.\r\n\r\n3개월 꾸준히 하다 보면 효과가 있는 업종이 아니라 하루하루 상황이 다른분야 입니다.\r\n아시겠지만 마케팅 10년 했어도 일주일 안하면 \r\n완전히 끝나는것과 같습니다.\r\n상담전화 기복이 심하고 안올때는 일주일정도 안와서 제안서와 문제점 견적을 요청드립니다.\r\n\r\n랜딩페이지 tcontour.com\r\n홈페이지 slcontour.com\r\n포스트,블로그 는 센스반영구아카데미로 \r\n검색하면 나옵니다.\r\n\r\n센스반영구클리닉과는 무관 합니다.', '', '', 0, 0, 75, 0, 0, '', '*C3A2CECB62A5F845791C013066BECE9DF818C26D', '김주형', 'gtdcp@naver.com', '', '2018-04-14 12:40:58', 0, '2018-04-14 12:40:58', '122.37.88.40', '', '', '', '센스반영구아카데미', '01023037232', '컨설팅 상담|||||||||||||', '전국||||||||||||||||||', '|||||||||', 'PC|MOBILE', '', '', ''),
	(14, -10, '', 14, 0, 0, '', '', 'secret,mail', '부동산', '경매회사인데요\r\n블로그운영은 하고있지만 블로그외에 다른 홍보방법이 어떤게 있는지 궁금합니다\r\nSns홍보 효과도 궁금하고요!', '', '', 0, 0, 99, 0, 0, '', '*004A80AA78B1A081F00924983E2242BA7B8112F3', '김지혜', 'oper1318@nate.com', '', '2018-04-19 01:52:29', 0, '2018-04-19 01:52:29', '175.223.18.69', '', '', '', '토지매매', '010-8883-8734', '|||||||페이스북 상담||SNS 기타||||', '전국||||||||||||||||||', '||||||SNS채널운영|||', 'PC|MOBILE', '', '', ''),
