	(35, -15, '', 35, 0, 0, '', '', 'secret,mail', '제약회사', '안녕하세요. 고려제약주식회사 마케팅팀의 임주리라고 합니다.\r\n저희가 곧 아토피에 도움을 주는 곰보배추 추출물로 제작된 로션 150ml을 출시할 예정입니다.\r\n(온라인판매용이며, 타겟은 예민하고 민감한 피부를 지닌 1030 세대입니다.)\r\n이 제품에 대해 앞으로 온라인종합광고대행사에 맡겨 온라인 홍보를 펼쳐나갈 구상을 하고 있습니다..\r\n다만 저희가 이와 비슷하게 아토피 제품 3품목을 2008년에 출시하였으나 판매가 매우 저조하여 이와 같이 될까 불안한감은 있습니다. (www.atoib.co.kr) <- 이 제품입니다.\r\n혹시 관련하여 온라인 광고 제안서를 보내주실 수 있을까요?\r\n비용에 따른 제안서는 여러 부류(예: 가성비형, 보통형, 프리미엄형 같은..)로 해서 제안을 해주시면 될 것 같습니다.\r\n빠른 회신 부탁드리겠습니다. 감사합니다.\r\n \r\nJu-ri Lim\r\nStaff/Marketing Team\r\nKorean Drug Corporation\r\n02-529-6100 (내선번호 : 355)', '', '', 0, 0, 51, 0, 0, '', '*F4C3FC8A9380CA33632B1243DF4EF80008E6357C', '임주리', 'jrim@nicepharma.com', '', '2018-07-02 10:39:14', 0, '2018-07-02 10:39:14', '211.192.201.200', '', '', '', '고려제약주식회사', '02-529-6100(내선:355)', '컨설팅 상담|||||||||||||', '전국||||||||||||||||||', '|||||||||', 'PC|MOBILE', '', '', ''),
