	(39, -18, '', 39, 0, 0, '', '', 'secret,mail', '쇼핑몰', '쇼핑몰 마케팅은 처음 진행하는 만큼 효율적으로 운영 가능한 방법에 대한 제안을 받고 싶습니다.\r\n초기예산은 100만원입니다.', '', '', 0, 0, 45, 0, 0, '', '*A5CD108B660849ECB17AC35925E063BD7F598CA9', '김은영', 'eykim@officemaster.co.kr', '', '2018-07-16 14:54:07', 0, '2018-07-16 14:54:07', '1.233.151.179', '', '', '', '오피스마스터', '02-400-1569', '컨설팅 상담||||검색어 상담||마케팅 기타|페이스북 상담||SNS 기타||||', '전국||||||||||||||||||', '||||연관검색/자동완성어||SNS채널운영|||', 'PC|MOBILE', '', '', ''),
	(40, -19, '', 40, 0, 0, '', '', 'secret,mail', '서비스업(온라인 인터넷가입유치 유선대리점)', '온라인 사이트로 SK,LG,KT 통신사 유선 대리점(인터넷가입유치) 을 운영중입니다. cpc광고를 통한 광고의 한계가 느껴져 다른방법을 찾고있습니다.\r\n 인스타그램, 페이스북 팔로워많으신분이나 파워블로거 등등 바이럴마케팅을 통한 광고를진행하고싶습니다~꼭바이럴마케팅만을 말하는것은아니며 더좋은방법이있다면 제안해주시면감사하겠습니다.  광고 집행예산의경우 협의가필요할거같은데 특정금액이아닌 광고로발생한 수익의 지분을 나눌생각을하고있는데요. \r\n진행이 시작되지않은상황에서 정확한 수익에대해 말씀드릴수없지만  타업종에비해 건수대비 수익이 높음을 강조드립니다. \r\n이런식의 광고진행이 가능한지 문의드립니다 .', '', '', 0, 0, 59, 0, 0, '', '*D142A988197D6E8B1D3D0945283450811637B73F', '김영재', '', '', '2018-07-16 20:41:50', 0, '2018-07-16 20:41:50', '221.146.21.171', '', '', '', '제이와이제이네트워크', '010-9550-8014', '컨설팅 상담|||||||||||||', '전국||||||||||||||||||', '|블로그 상위노출||지식인 상위노출|연관검색/자동완성어|컨텐츠 바이럴||||기타', 'PC|MOBILE', '', '', ''),
	(38, -17, '', 38, 0, 0, '', '', 'secret,mail', '남성의류 쇼핑몰', '남성의류 쇼핑몰 창업 준비중입니다.\r\nSNS마케팅 관련해서 문의드리고 싶어 연락드립니다.', '', '', 0, 0, 57, 0, 0, '', '*392332C79FE6367FD9452BC0EED8E4083F95D36E', '김현석', 'rlagustjr416@naver.com', '', '2018-07-14 12:06:54', 0, '2018-07-14 12:06:54', '175.210.38.93', '', '', '', '그날의', '010-7153-4686', '|||||||페이스북 상담|인스타그램 상담|||||', '전국||||||||||||||||||', '||||||SNS채널운영|||', '|MOBILE', '', '', ''),
	(41, -20, '', 41, 0, 0, '', '', 'secret,mail', '도시락 샌드위치 전문점', '수제도시락 샌드위치 전문점입니다  단체 도시락,홈파티음식을 같이 하고있는데 블로그와 인스타를 제가 하고있지만 한계를 느껴서 전문가의 도움을 바랍니다 \r\n마케팅에 대해서는 무지해서 상담드립니다\r\n어떤식으로 진행 하시는지 금액은 어느정도 인지 문의 드립니다', '', '', 0, 0, 50, 0, 0, '', '*99AA650B94ADE0C065CFC6DA3E8BCFD7484A1B36', '김보정', '', '', '2018-07-17 12:34:20', 0, '2018-07-17 12:34:20', '58.77.163.204', '', '', '', '하루한끼 더스푼', '01055516443', '|||블로그 상담|||||인스타그램 상담|||||', '|서울|경기||||||||||||||||', '블로그 운영||||||SNS채널운영|||', '|MOBILE', '', '', ''),
	(131, -96, '', 131, 0, 0, '', '', 'secret,mail', '제조업', '안녕하세요 \r\n\r\n업소용 냉장고 , 쇼케이스 , 업소용 스텐제품 일체를 제작하는 한국냉동산업 이라고합니다. \r\n\r\n저희가 지금 온라인 마케팅은 블로그와 체험단을 통해서만 진행하고 있습니다 .\r\n\r\n고객의 직접방문을 유도하여 소비자와 직접적인 연결을 통한 매출증대를 기대하고있습니다\r\n\r\n현재 진행하고있는정도를 대체하였을때 견적을 알고싶고 추가로 저희가 여러 매체를 통해 광고를 진행하게되면 \r\n\r\n매체별 금액이 어떻게되는지 , 차후 관리를 어떻게 해주시는지 전반적으로 알고싶습니다.\r\n\r\n 저희와 유사한 업종에대한 마케팅 경험이 있으신지  알고싶습니다. \r\n\r\n저희의 마케팅을 진행하시게 되면 어떤  청사진을 가지고 진행하시는지 대략적인 스케쥴도 알고싶습니다.\r\n\r\n감사합니다.', '', '', 0, 0, 43, 0, 0, '', '*6BB4837EB74329105EE4568DDA7DC67ED2CA2AD9', '이현준', 'rkthr@naver.com', '', '2019-01-31 18:19:46', 0, '2019-01-31 18:19:46', '218.148.129.30', '', '', '', '한국냉동산업', '01091705642', '컨설팅 상담|조사 상담|브랜드 상담|블로그 상담|검색어 상담|카페 상담|마케팅 기타|페이스북 상담|인스타그램 상담|SNS 기타||||', '전국|서울|경기|인천|||||||||||||||', '블로그 운영|블로그 상위노출||||컨텐츠 바이럴||||', 'PC|MOBILE', '', '', ''),
	(43, -22, '', 43, 0, 0, '', '', 'secret,mail', '교육기관', '연구원 건설과 사람 교육관리팀 이세린입니다.\r\n\r\n저희는 건설기술인의 법정교육을 진행하게 될 기관이며, 신규 종합교육기관으로 지정될 시 \r\n\r\n저희 교육기관을 홍보하고 싶어 바이럴마케팅 업체를 알아보고 있으며 귀사에 아래와 같이 문의 드립니다.\r\n\r\n홍보내용은 교육기관 홍보, 교육에 대한 안내, 연간 교육 일정표 등 이며, \r\n\r\n블로그와 카페에 홍보 시 절차 및 비용이 궁금합니다. \r\n\r\n답변부탁드립니다. 감사합니다.', '', '', 0, 0, 41, 0, 0, '', '*4BC9F5A7BCE4CD270F377FD7D960729DBCC37923', '이세린', 'dltpfls0@chri.re.kr', '', '2018-07-23 10:12:36', 0, '2018-07-23 10:12:36', '58.120.128.66', '', '', '', '연구원 건설과 사람', '0234169054', '|||블로그 상담||카페 상담||||||||', '|서울|||||||||||||||||', '|블로그 상위노출||||||네이버 포스트||', 'PC|MOBILE', '', '', ''),
	(44, -23, '', 44, 0, 0, '', '', 'secret,mail', '소상공인지원사업', '아직 확정된 사항이 아니라서 바이럴마케팅, SNS마케팅 등과 관련해서 광고 단가표를 먼저 받아보고 추후 상담을 진행해보고 싶습니다.\r\n위 메일로 보내주시면 감사하겠습니다^^\r\n감사합니다.', '', '', 0, 0, 44, 0, 0, '', '*DE70DE5FC2F122CEA8A35DE57DF8D37CDD65C0E8', '장지원', 'ldissi98@dcb.or.kr', '', '2018-07-25 09:41:04', 0, '2018-07-25 09:41:04', '222.237.159.190', '', '', '', '', '', '|||블로그 상담|||마케팅 기타|페이스북 상담|인스타그램 상담|SNS 기타||||', '전국||||||||||||||||||', '|블로그 상위노출|||연관검색/자동완성어|컨텐츠 바이럴|SNS채널운영|||', 'PC|MOBILE', '', '', ''),
