	(46, -25, '', 46, 0, 0, '', '', 'secret,mail', '도소매, 무역', '저희 상품을 블로그나 카페나 등등 판매를 위해 홍보하려는 목적입니다.', '', '', 0, 0, 77, 0, 0, '', '*EB2A49F33AA1F344B98FF24062ABB0D4A090B79C', '곽효근', 'lamareekorea@naver.com', '', '2018-07-30 15:40:10', 0, '2018-07-30 15:40:10', '221.147.34.126', '', '', '', '(주)마레인터내셔널', '010-6279-8440', '|||블로그 상담||카페 상담|마케팅 기타|||||||', '전국||||||||||||||||||', '|||||||||기타', 'PC|', '', '', ''),
