	(48, -27, '', 48, 0, 0, '', '', 'secret,mail', '포장재 쇼핑몰', '비닐포장재 쇼핑몰 관련한 마케팅 문의드립니다.\r\n현재 쇼핑몰 제작 완료단계(현재 오픈전)에 있으며, 유사 사이트로는\r\n\r\n네이버검색 : 팩플러스, 홍진포장, 다산팩 \r\n\r\n있습니다.', '', '', 0, 0, 50, 0, 0, '', '*013F4F4214959199614BCE99A653E2719ED16681', '박서준', 'naughtytotoro@naver.com', '', '2018-07-31 16:02:28', 0, '2018-07-31 16:02:28', '183.99.86.123', '', '', '', '시크릿', '01022042291', '|||||||||||||', '전국||||||||||||||||||', '|||지식인 상위노출|연관검색/자동완성어|컨텐츠 바이럴||네이버 포스트|보도자료 송출|', 'PC|MOBILE', '', '', ''),
	(49, -28, '', 49, 0, 0, '', '', 'secret,mail', '전자부품 제조업체', '안녕하세요\r\n지식인 마케팅 문의합니다.\r\n미르시스템은 전자부품 제조업체입니다.\r\n키워드는 #미르시스템 #PCB #PCB설계 #PCBARTWORK #SMT 총 5가지 입니다.\r\n이메일로 견적서 부탁드립니다.\r\n감사합니다.', '', '', 0, 0, 43, 0, 0, '', '*2B43602D6A887D58FD18F6658C8D1B8F601CDE9D', '김영진', 'yjkim@theappstation.co.kr', '', '2018-08-01 15:59:25', 0, '2018-08-01 15:59:25', '211.33.141.251', '', '', '', '미르시스템', '0221139115', '||||||마케팅 기타|||||||', '전국||||||||||||||||||', '|||지식인 상위노출||||||', 'PC|MOBILE', '', '', ''),
	(50, -29, '', 50, 0, 0, '', '', 'secret,mail', '컴퓨터 단축키', '\'워드 단축키\', \'엑셀 단축키\', \'파워포인트 단축키\' 3개의 키워드로 \r\n네이버 검색 상위노출 (블로그) 보장을 위한 상품 1달 기준으로 가능한 지 \r\n진행시 준비해야하는 예상 콘텐츠 분량이 어느정도인지\r\n문의 드립니다.', '', '', 0, 0, 47, 0, 0, '', '*5C6C0DC04C2FE88530A25B1009F3D3AEAB9A5959', '강민채', 'bonjour_91@naver.com', '', '2018-08-01 16:11:17', 0, '2018-08-01 16:11:17', '211.218.239.246', '', '', '', '', '01030247574', '|||블로그 상담||||||||||', '전국||||||||||||||||||', '|블로그 상위노출||||||||', 'PC|MOBILE', '', '', ''),
	(51, -30, '', 51, 0, 0, '', '', 'secret,mail', '음악', '안녕하세요.\r\n저희는 밴드 노다이그런지(No die grunge)라고합니다.\r\n음악을 함에있어  제일 중요한 홍보 효과를 보기 너무 어려워 제안서를 요청드립니다.\r\n일정 기업이아닌만큼 SNS위주의 채널 운영과 유투브의 컨텐츠를 홍보하고싶습니다.\r\n보도자료의경우는 추후 나올 음원에대한 보도자료를 송출하고싶습니다.\r\n감사합니다.', '', '', 0, 0, 46, 0, 0, '', '*138DF6C5F32DE2D662637D3B76643008CCE61446', '임찬경', 'ultrabad9@naver.com', '', '2018-08-03 17:57:23', 0, '2018-08-03 17:57:23', '121.66.73.156', '', '', '', '노다이그런지(no die grunge)', '01030612126', '||||||||인스타그램 상담|||||', '전국||||||||||||||||||', '|||||컨텐츠 바이럴|SNS채널운영||보도자료 송출|', '|MOBILE', '', '', ''),
	(52, -31, '', 52, 0, 0, '', '', 'secret,mail', '앱서비스', '1. 목적 : 스마트 폰 다운로드 및 어플 활성화 마케팅(다운로드, 어플 활성화) \r\n2. 대상 : 현재 런칭 운영중인 스마트폰 어플이며, 단계적 기능반영이 계획되어 있음\r\n3. 현황 : 현재 2000 Download(실다운로드), 일접근 횟수(180~200회:로딩기준)\r\n4. 의뢰내용 : \r\n1) 현 어플에 대한 마케팅 전략수립\r\n2) 단계적 이행 Plan수립(기획), SWOT 단계적 대응방안 수립/기획 및 이행\r\n3) 성과분석 및 전략 수정등의 마케팅 업무 추진', '', '', 0, 0, 59, 0, 0, '', '*B8614AC930C93C2274C4BB4FC31E43E127EB41DF', '송진수', 'orion0321@gmail.com', '', '2018-08-05 19:46:30', 0, '2018-08-05 19:46:30', '182.212.113.223', '', '', '', '비공개_별도 미팅', '010-5746-0810', '컨설팅 상담|||||||||||||', '전국||||||||||||||||||', '|||||컨텐츠 바이럴|SNS채널운영|||', '|MOBILE', '', '', ''),
