	(166, -131, '', 166, 0, 0, '', '', 'secret,mail', '음식점', '제주도에서 피자집(섭지코지화덕피자)를 운영하고 있습니다.\r\n2년간 꾸준히 해온것은 아니나,\r\n책자광고, 체험단,기자단,상위노출,배포형 등등등\r\n여러가지 광고를 진행을 했었습니다.\r\n하지만 제주도 여행 특성상 보통 여행자들은 흑돼지,회,조림 등등\r\n로컬음식을 검색을 많이 하더라구요. \r\n결국에는 비용대비 효과를 많이 보질 못했습니다.\r\n또한, 저희 매장은 가족단위 손님이 70%, 젊은손님 및 커플 20%, 그외 손님 10% 정도 되는것 같아요\r\n젊은층을 늘리고 싶은데, sns/블로그 등등 광고를 해보려 합니다.\r\n제주도 지역이고 피자집이라 어떤 방법이 효과적인지 문의드립니다.', '', '', 0, 0, 36, 0, 0, '', '*D5A4BF13590ACEB1FB75C16A4EB746AEDFD19082', '조효상', 'novelizer@naver.com', '', '2019-09-06 16:22:26', 0, '2019-09-06 16:22:26', '182.214.177.13', '', '', '', '섭지코지화덕피자', '010-3554-3481', '컨설팅 상담|||블로그 상담||||페이스북 상담|인스타그램 상담|SNS 기타||||', '|||||||||||||||||제주|', '|블로그 상위노출|||연관검색/자동완성어|||네이버 포스트||', '|MOBILE', '', '', ''),
