	(57, -36, '', 57, 0, 0, '', '', 'secret,mail', '의류', '안녕하세요, 더웨이나인이라는 의류 정장 업체인데요 :)\r\n블로그체험단진행을 해보고싶어서 문의드리려고합니다.\r\n1. 보통 의류쪽은 지원자 수가 어느정도 될까요?\r\n2. 상위노출 여부는 어떻게 되는걸까요?\r\n3. 체험 진행중과 마친 후의 보고는 어떻게 주시는 걸까요?\r\n4. 오프라인매장 10명정도로 진행해보고싶은데 견적서랑 함께 이메일로 회신해주실 수 있나요?\r\n5. 오프라인매장 5명과 온라인쇼핑몰 5명 이렇게 진행도 가능할까요?\r\n    가능하다면 견적 부분도 달라지는걸까요?', '', '', 0, 0, 46, 0, 0, '', '*33EA8902109F3995B059A9A72DEA372E9A8A5E93', '이현아', 'thewayadm@gmail.com', '', '2018-08-20 14:55:58', 0, '2018-08-20 14:55:58', '1.221.73.157', '', '', '', '더웨이나인', '1666-3987', '|||블로그 상담|검색어 상담|||||||||', '||||||||||||||||||', '블로그 운영|블로그 상위노출||||||||', 'PC|MOBILE', '', '', ''),
	(58, -37, '', 58, 0, 0, '', '', 'secret,mail', '카페 프랜차이즈', '카페 프렌차이즈 준비중에 있느\r\n미지엄이라는 회사입니다.\r\n현재 1호점 오픈상태입니다.\r\n블로그 노출광고와  언론노출 광고 비용 문의 드립니다.', '', '', 0, 0, 56, 0, 0, '', '*E3435A5F181C8D94719194E3BF8E91DC4464A8A5', '정석모', 'tree_sm@naver.com', '', '2018-08-22 14:03:55', 0, '2018-08-22 14:03:55', '119.65.83.164', '', '', '', '미지엄', '01085461685', '||||||마케팅 기타||||언론기사|||', '||||||||||||||||||', '|블로그 상위노출|||||||보도자료 송출|', '|MOBILE', '', '', ''),
	(59, -38, '', 59, 0, 0, '', '', 'secret,mail', '디자인가구', '안녕하세요 찰스입니다.\r\n디자인가구 no.1를 향하는 가구업체입니다.\r\n홈페이지 www.chals.co.kr를 참고하시기 바랍니다.\r\n\r\n파주매장,세종매장에 대한 홍보를 하려고 합니다.\r\n30~50대 신혼가구 , 부부(이사) 고객이 방문하게 만드는 것입니다.\r\n즉 목표는 매장에 방문하게 만들어서 매출 증대입니다.\r\n기간와 비용은 월 500만에 3개월 기간으로 하려고 합니다.   \r\n\r\n이에 대한 제안을 받으려고 합니다.\r\n감사합니다.', '', '', 0, 0, 55, 0, 0, '', '*1F7BF00A39F7DBFEC4A92D05741736E8A253F29B', '이원희', 'tonylee@chals.co.kr', '', '2018-08-23 10:27:07', 0, '2018-08-23 10:27:07', '118.33.31.225', '', '', '', '찰스', '010-6521-7588', '컨설팅 상담|||블로그 상담|검색어 상담|카페 상담|||인스타그램 상담|||||', '|서울|경기||||||세종||충북|충남|||||||', '|블로그 상위노출|||연관검색/자동완성어|컨텐츠 바이럴||||', 'PC|MOBILE', '', '', ''),
