	(61, -40, '', 61, 0, 0, '', '', 'secret,mail', '부동산, 통신정보업', '안녕하세요. 저희는 집나와라는 빌라 정보 플랫폼을 운영하고 있는\r\n씨에이씨 컴퍼니라는 업체입니다. 공식 블로그 운영과 건바이 블로그 상위노출에 대한 문의 드리고자 합니다. \r\n내용 확인되시면 연락 부탁 드리겠습니다. \r\n고맙습니다 ^^', '', '', 0, 0, 55, 0, 0, '', '*6F18DCABB7CC45E95A5A067B4745914A63A88198', '유병택', 'yubt@caccompany.co.kr', '', '2018-08-28 15:48:45', 0, '2018-08-28 15:48:45', '27.117.168.101', '', '', '', '씨에이씨컴퍼니', '01092182322', '컨설팅 상담|||블로그 상담||||||||||', '전국||||||||||||||||||', '블로그 운영|블로그 상위노출||||||||', 'PC|MOBILE', '', '', ''),
	(62, -41, '', 62, 0, 0, '', '', 'secret,mail', '의원', '제대로 홍보하지 않은채로 개원해서. 홍보를 좀 해보려고 합니다. 제주도 통증병원 또는 제주도 허리통증 같은 블로그검색이나 연관검색어에 노출되는게 가장 효과적이지 않을까 생각했는데요. 상담을 좀 받고자 합니다.', '', '', 0, 0, 66, 0, 0, '', '*2FD9F0955FA8DD4B8DB86D2CFACBC5A52DE75E2E', '이유진', 'zest_4079@naver.com', '', '2018-08-28 22:02:30', 0, '2018-08-28 22:02:30', '61.85.11.142', '', '', '', '통증의학과', '010.9727.6531', '|||블로그 상담|검색어 상담|카페 상담||||||||', '|||||||||||||||||제주|', '|블로그 상위노출|||연관검색/자동완성어|||||', '|MOBILE', '', '', ''),
