	(162, -127, '', 162, 0, 0, '', '', 'secret,mail', '일반음식점, 포차', '썸잉, 플레잉 강남 홍대점을 운영중입니다\r\n해당 브랜드에대한 프랜차이즈를 준비하고자 하여 보다 종합적인 광고기획을 원하고 있습니다\r\n단순하게  일부매체에 한해 광고를 하는것보다 브랜드홍보를 기획하고 싶습니다', '', '', 0, 0, 52, 0, 0, '', '*D418398FE2E78A8688E5C891E11CFD6AAA52AB88', '엄기훈', 'rtheo@naver.com', '', '2019-08-16 20:49:34', 0, '2019-08-16 20:49:34', '222.110.228.104', '', '', '', '썸잉', '01094365085', '컨설팅 상담||브랜드 상담|||||||||||', '전국|서울|||||||||||||||||', '|||||||||', '|', '', '', ''),
	(64, -43, '', 64, 0, 0, '', '', 'secret,mail', '대행사', '안녕하세요.\r\n지난번 칼로커트 상위노출 요청드렸던\r\n디플래너 한나입니다 ^^\r\n\r\n한가지 더 요청드릴 사항이 있어서 문의드립니다~\r\n지난번에는 칼로커트 키워드로 견적을 요청드렸었는데요\r\n혹시 일반 키워드 견적도 가능하신지 문의드립니다\r\n\r\n키워드는 아래와 같습니다.\r\n[효과좋은다이어트보조제 / 다이어트보조제추천 / 다이어트보조제 / 요요없는다이어트 / 출산후다이어트]\r\n\r\n확인부탁드립니다.\r\n감사합니다.', '', '', 0, 0, 50, 0, 0, '', '*BDD9E338225C110955B886DEEC33C7FCBF864490', '한나', 'dplanner9@naver.com', '', '2018-08-30 16:27:43', 0, '2018-08-30 16:27:43', '1.214.238.218', '', '', '', '디플래너', '01065335218', '|||블로그 상담||||||||||', '전국||||||||||||||||||', '|블로그 상위노출||||||||', 'PC|MOBILE', '', '', ''),
