	(84, -54, '', 84, 0, 0, '', '', 'secret,mail', '레저시설 운영/케이블카 운영', '2019년 1월 오픈예정인 청풍로프웨이(주)입니다.\r\n충북 제천 청풍호 인근에 관광 케이블카 시설을 현재 공사중이며, 2019년 1월 오픈예정입니다.\r\n바이럴 마케팅쪽을 집중으로 마케팅 진행을 기획하고 있습니다.\r\n마케팅 항목은\r\n- 파워블로그 체험단 운영하여 체험 후기 포스팅(주요 키워드 포스팅 삽입)  - 매월 10여팀 \r\n- 포스팅된 블로그 상위 노출작업 \r\n- 연관 검색어 노출 \r\n- SNS 마케팅(컨텐츠 제작 및 배포로 높은 도달율 확보) / 주요 키워드 해시태그 TOP9노출(인스타그램)\r\n- 페이스북/인스타그램 계정관리\r\n\r\n해당 운영기간은 1년으로 생각하고 있습니다.(SNS 마케팅의 경우 초기 6개월 정도만 진행 생각)\r\n\r\n관련하여 제안서 및 견적 의뢰 요청드립니다.\r\n\r\n진행은 12월 부터 진행을 생각하고 있습니다.\r\n보시고, 문의사항 있으시면 연락 부탁드리며, 빠른 회신 요청드립니다.', '', '', 0, 0, 65, 0, 0, '', '*1B7672DBD5EBD7E59522079229B93143EC36001D', '김성원', 'n2a_cyclone@naver.com', '', '2018-09-18 16:50:12', 0, '2018-09-18 16:50:12', '211.38.246.35', '', '', '', '청풍로프웨이', '010-4477-2052', '|||블로그 상담||||페이스북 상담|인스타그램 상담|SNS 기타||||', '||||||||||충북||||||||', '|블로그 상위노출|||연관검색/자동완성어||SNS채널운영|||', 'PC|MOBILE', '', '', ''),
