	(105, -72, '', 105, 0, 0, '', '', 'secret,mail', '참치회&냉동수산물 도,소매전문', '현재 자체 홈페이지(판매 쇼핑몰)는 개설되어 있으나, 본격적인 판매와 홍보를 위해 제품 상세페이지 보충과 자체 블로그 개설, 컨텐츠 등록, 키워드 광고 및 검색어 설정, 네이버예약 페이지 구성, 연관 검색어, 체험단 포스팅, SNS광고 등을 운영 진행하고자 하오니 상담부탁드립니다.', '', '', 0, 0, 61, 0, 0, '', '*AA11ABEBC768EBAA145F3DF1340D10F1DCC84C9D', '김중호', 'k-joongho@naver.com', '', '2018-10-24 13:38:03', 0, '2018-10-24 13:38:03', '125.129.229.77', '', '', '', '(주)유진씨푸드', '01045418300', '|||블로그 상담|검색어 상담||||인스타그램 상담|SNS 기타||||', '전국||||||||||||||||||', '|블로그 상위노출|||연관검색/자동완성어|||네이버 포스트||', 'PC|MOBILE', '', '', ''),
	(106, -73, '', 106, 0, 0, '', '', 'secret,mail', '음식', 'ㄹㅇㄴㄹㅇㄴㄹㄴㅇㄹㅇㄴㄹㄴㅇㄹㄴ', '', '', 0, 0, 46, 0, 0, '', '*35582EC8428D2CF2FB576A4BBA338E92973DC008', '오인숙', '', '', '2018-10-30 09:01:30', 0, '2018-10-30 09:01:30', '211.193.39.46', '', '', '', '와따가리', '00000000', '||||검색어 상담|||||||||', '|서울|||||||||||||||||', '|블로그 상위노출||||||||', '|', '', '', ''),
