	(137, -102, '', 137, 0, 0, '', '', 'secret,mail', '화장품', '안녕하세요?\r\n저희는 피부관리실시장에서만 20년이상 화장품을 판매해온 회사입니다. 오로지 피부관리실 원장님을 상대로 판매를 해왔으나 저희가 이제는 회사를 가산디지털단지내에 있는 240평크기의 사무실을 얻어서 리테일시장으로 본격적으로 진입하려고 준비하고 있습니다. 이런 변화를 하게 된 계기가 된 이유는 저희가 이태리 라코테 괌(LACOTE GUAM) 바디슬리밍 전문브랜드를 국내독점계약을 작년말에 체결하여 이제품들을 선두로해서 리테일시장에 진출하고자 결정하게 되었습니다.\r\n\r\n그래서 현재 사내에 화장품을 진열하고 럭셔리한 이미지로 장식하여 외부손님들과 피부관리실원장님을 비롯해서 많은 일반인들까지도 방문하여 제품홍보를 할수있는 쇼룸의 공간을 만들고 있습니다. \r\n\r\n그런데 현재 공간만 만들어진 상태고 이미지부터 제품데코레이션등등은 마켓터 업체가 선정이 되면 그분을 통해서 제품자체의 스터디를 통한 컨셉파악-쇼룸디자인완성-VMD선정-오픈식세리모니준비-오피니언리더및 외부인플루언서초대-각종 카달로제작 및 홈페이지제작-블로그,카페,인스타그램등등 SNS활동등을 순서에 입각해서 일사분란하게 진행하려고 계획하고 있습니다. \r\n\r\n제가 간략하게 저희가 추진하려고 하는 사항들을 간략하게 정리해봤는데요. 저희사장님과 함께 이런전반적인 마켓팅전략들을 귀사와 심도있게 논의를 하고 싶습니다. 저희사무실의 모습과 제품및 쇼룸등을 보시고 같이 얘기나눌수있도록 가급적 저희 사내에 방문하시어 말씀을 나눠볼수있도록 연락해 주시면 감사하겠습니다.\r\n\r\n(주)비엠제이코리아 김호원팀장', '', '', 0, 0, 120, 0, 0, '', '*C66D7FE66E1F38223B2E53CAB3EBA91CD0548FEF', '김호원', 'bjkorea134@naver.com', '', '2019-02-28 11:09:29', 0, '2019-02-28 11:09:29', '175.197.68.125', '', '', '', '(주)비엠제이코리아', '010-2433-3652', '컨설팅 상담|||||||||||||', '|서울|||||||||||||||||', '블로그 운영|블로그 상위노출|카페운영/관리|지식인 상위노출|연관검색/자동완성어|컨텐츠 바이럴|SNS채널운영|네이버 포스트|보도자료 송출|기타', 'PC|MOBILE', '', '', ''),
