	(129, -94, '', 129, 0, 0, '', '', 'secret,mail', '화장품', '안녕하세요! 문의드립니다. \r\n\r\n페이스북 / 인스타그램 홍보마케팅 > 자사몰 유입 \r\n블로그 / 네이버 검색어 쪽으로도 상담 받고 싶어요!', '', '', 0, 0, 43, 0, 0, '', '*212A734D7BAA6C2EFAEC8080F6424DD147BB223A', '정솔지', 'jsj8407@naver.com', '', '2019-01-23 14:53:01', 0, '2019-01-23 14:53:01', '39.116.183.56', '', '', '', '(주)루벨리', '01035780662', '컨설팅 상담||||검색어 상담|||페이스북 상담|인스타그램 상담|||||', '|||||대구|||||||||||||', '|||||컨텐츠 바이럴|SNS채널운영|||', 'PC|MOBILE', '', '', ''),
	(130, -95, '', 130, 0, 0, '', '', 'secret,mail', '뮤지컬극단', '안녕하세요  먼저 소개를 드리면 저희는 Jason Taylar 이라는 뉴질랜드 사람이 운영하고 있는 뮤지컬 극단 입니다.\r\n(저는 Jason의 일을 도와주고 있는 assistant 입니다.)\r\n저희는 주중에는 원어민영어회화 수업을 진행중이고, 주말에 뮤지컬 극단 수업을 진행합니다. (극단은 학원 개념이 아닙니다. 별개로 진행중입니다.)\r\n학원이 운영된지는 이제 2년 째 이고, 현재 원어민영어회화 원생 수는 평균 130명을 유지중이고,\r\n뮤지컬 극단은 작년 11월에 시작해서 원어민영어회화 원생들에게만 홍보를 하여 15명의 인원을 보유중입니다. \r\n\r\n저희는 경기도 용인시 기흥구 동백에 위치하고 있으며, \r\n기흥, 수지, 동탄, 수원, 분당 정도의 지역에 학원이 홍보되었으면 좋겠습니다.\r\n어떤 방법으로 홍보를 도와주실 수 있는지 오프라인, 온라인 으로 나눠서 제안서를 요청드립니다.  (가격대도 함께 알려주시면 감사하겠습니다.)', '', '', 0, 0, 42, 0, 0, '', '*ED461ABD66A570EFEB824D4C8FED4E30FEAF8ED5', '제이슨테일러', 'hena90@naver.com', '', '2019-01-24 18:10:11', 0, '2019-01-24 18:10:11', '222.99.230.146', '', '', '', 'JEM (Jason English Musical Entertainment)', '01073023212', '||||||마케팅 기타|||||||', '||경기||||||||||||||||', '|||||||||기타', '|', '', '', ''),
