	(95, -65, '', 95, 0, 0, '', '', 'secret,mail', '베이커리', '저의 빵집을 홍보해서 매출을 올리고 싶은데 어떤 방법을 해야할지 막막합니다.\r\n제안을 한번보고싶습니다', '', '', 0, 0, 45, 0, 0, '', '*2DAE450BA80254776C221EF72636CCF342A21EB9', '정진우', 'eunmeal@naver.com', '', '2018-10-09 19:53:06', 0, '2018-10-09 19:53:06', '112.156.29.46', '', '', '', '은밀', '01072787605', '컨설팅 상담|||||||||||||', '|서울|||||||||||||||||', '블로그 운영||카페운영/관리|지식인 상위노출|||SNS채널운영|네이버 포스트||', 'PC|MOBILE', '', '', ''),
	(128, -93, '', 128, 0, 0, '', '', 'secret,mail', '농수산물판매', '직접 농사지은 농산물( 마늘 절임배추 참기름 김치 ) 과 수산물 (파래 다시마 미역 멸치 김) 등을 \r\n쇼핑몰 오픈하여  판매예정입니다\r\n\r\n현재 온라인판매는 한달정도 체험하였는데\r\n1. 네이버 직거래카페에 올려봄\r\n2. 블로그 글 50개정도 올려봄\r\n3. 페이스북 글쓰며 홍보 친구3천명\r\n4. 인스트그램 홍보 팔로워250명\r\n\r\n만약 쇼핑몰 오픈보다 다른방향으로 판매하는것이 더 좋다면 방향을 바꿀예정이고 \r\n홍보관련하여 자세한 상담및 제안 요청드립니다', '', '', 0, 0, 42, 0, 0, '', '*EE807AA02CBE6C186DB58769A1D15EB2F5D34D10', '윤여선', 'bay0911@naver.com', '', '2019-01-20 00:06:23', 0, '2019-01-20 00:06:23', '123.212.143.173', '', '', '', '수래농산', '01049774920', '컨설팅 상담|조사 상담|브랜드 상담|블로그 상담|검색어 상담||마케팅 기타|||||||', '전국||||||||||||||||||', '|블로그 상위노출||지식인 상위노출|연관검색/자동완성어|컨텐츠 바이럴|SNS채널운영|네이버 포스트||', '|MOBILE', '', '', ''),
	(127, -92, '', 127, 0, 0, '', '', 'secret,mail', '광고마케팅', '안녕하세요.\r\n미디어허브 팅글포스트 담당자 안수지라고합니다.\r\n\r\n현재 저희 팅글 포스트의 콘텐츠 기획, 제작 및 영업 마케팅을 담당 해주실 대행사를 찾다가 문의 남깁니다.\r\n좋은 협업을 기대하며 관련하여 소개서 전달주시면 확인 후 문의 드릴 수 있도록 하겠습니다.\r\n\r\nansuji0327@emediahub.co.kr\r\n\r\n감사합니다.', '', '', 0, 0, 52, 0, 0, '', '*22F374B90421DF3E1E349CF4B2C31E11D83C25E6', '안수지', 'ansuji0327@emediahub.co.kr', '', '2019-01-10 17:42:26', 0, '2019-01-10 17:42:26', '115.93.204.5', '', '', '', '미디어허브', '01040092241', '||||||마케팅 기타|||||||', '|서울|||||||||||||||||', '|||||||네이버 포스트||', 'PC|MOBILE', '', '', ''),
	(97, -67, '', 97, 0, 0, '', '', 'secret,mail', '프렌차이즈', '마케팅 상품별 비용이 궁금합니다.', '', '', 0, 0, 57, 0, 0, '', '*319A8F082EADDE2F58FCC958400EC56B2C94D87D', '유지은', 'dbwldms3711@naver.com', '', '2018-10-11 17:53:02', 0, '2018-10-11 17:53:02', '211.63.210.176', '', '', '', '데크인터네셔널', '01090365217', '컨설팅 상담|||블로그 상담|검색어 상담|카페 상담|마케팅 기타||||||대중교통 마케팅|', '전국||||||||||||||||||', '|블로그 상위노출||지식인 상위노출|연관검색/자동완성어|||네이버 포스트|보도자료 송출|기타', 'PC|MOBILE', '', '', ''),
