	(118, -83, '', 118, 0, 0, '', '', 'secret,mail', '온라인마케팅', '안녕하세요,\r\nABC마트 온라인 대행사 HITCH의 박재헌입니다. \r\n\r\n이번에 ABC마트에서 총결산세일을 준비하면서\r\n블로그 마케팅을 진행하려고 합니다.\r\n파워블로거를 활용하기 원하며\r\n진행할 내용은 하기 내용과 같습니다.\r\n___________________________________\r\n행사 기간 : 11/22~12/22 전국 ABC마트\r\n\r\n1. 사전 : 행사 노미네이트 용도\r\n*인원 : 3~5명\r\n*노출 일자 : 11월 20일(화)~21일(수)\r\n\r\n2. 사후 : 현장(매장)방문하여 체험 후기 또는 리뷰 정도\r\n\r\n* 인원 : 5명\r\n\r\n* 노출 일자 : 11월 22일(목)~26일(월)\r\n_______________________________________\r\n\r\n키워드는 \'ABC마트\', \'ABC마트세일\', \'블랙ABC데이\' 입니다.\r\n\r\n따라서 견적서를 요청드리는 바인데, 하기 사항을 포함해서 요청드립니다.\r\n\r\n1. 상위노출 가능 여부 \r\n2. 상위노출 가능 여부에 따른 견적\r\n3. 사전, 사후 용도에 따른 견적\r\n\r\n확인 후 연락 부탁드리겠습니다.\r\n감사합니다.\r\n\r\nphone : 010 -2381 -7358\r\ne-mail : pjh@hitchkorea.com', '', '', 0, 0, 57, 0, 0, '', '*D27BE0CA3B2EAD4FB5D3DA33F63A2BC57EFC58AC', '박재헌', 'pjh@hitchkorea.com', '', '2018-11-14 12:03:08', 0, '2018-11-14 12:03:08', '183.96.226.238', '', '', '', 'HITCH', '01023817358', '|||블로그 상담||||||||||', '|서울|경기||||||||||||||||', '|블로그 상위노출||||||||', 'PC|MOBILE', '', '', ''),
	(135, -100, '', 135, 0, 0, '', '', 'secret,mail', '외식업(한식)', '안녕하세요 \r\n자성화 맛집 코다리네 본사의 이수진과장입니다\r\n브랜드 입소문도 있는 편이고 홈페이지도 있지만 체계적인 마케팅에 취약하여 종합적인 솔루션을 받아보고자 합니다\r\n제안서를 메일로 보내주시면 검토후 연락드리겠습니다\r\n감사합니다\r\nwww.jasunghwa.kr', '', '', 0, 0, 60, 0, 0, '', '*45E0F51F9A819A719A37FC96C8B41C7C2FBD91A0', '이수진 과장', 'nansicheda@naver.com', '', '2019-02-11 16:10:30', 0, '2019-02-11 16:10:30', '113.199.37.52', '', '', '', '자성화 맛집 코다리네', '01042073405', '|||||||||||||', '||||||||||||||||||', '|||||||||', '|', '', '', ''),
	(136, -101, '', 136, 0, 0, '', '', 'secret,mail', '노인 주간보호센터', '안녕하세요. \r\n한유정이라고 합니다. \r\n주야간보호센터 오픈 예정으로 블로그 홍보에 관심이 있어 문의드립니다.\r\n블로그 체험단, 검색어 상위노출, 연관검색, 연예인 섭위에 대해 견적 부탁드립니다. \r\n감사합니다.', '', '', 0, 0, 64, 0, 0, '', '*FCD73A33D3B10EDB8EE6AF118793591CAEBF6705', '한유정', 'uuuuuu08@naver.com', '', '2019-02-14 10:31:58', 0, '2019-02-14 10:31:58', '211.215.175.226', '', '', '', '웰더스 주야간보호센터', '01099927577', '|||블로그 상담|검색어 상담|||||||||연예인 섭외', '||경기||||||||||||||||', '|블로그 상위노출||지식인 상위노출|연관검색/자동완성어|||||', 'PC|', '', '', ''),
	(134, -99, '', 134, 0, 0, '', '', 'secret,mail', '무역, 도/소매', '안녕하십니까,\r\n\r\n미용기기를 수입하여 총판을 진행하려고 합니다.\r\n\r\n페이스북, 인스타그램, 블로그포스팅을 통하여 광고를 진행하려고 하는데\r\n\r\n많이 질문 받아보셨을 것이라고 생각되지만 금액이 관건이라 \r\n\r\n구체적인 광고진행방법과 계약프로세스, 비용에 대해서 문의드리고 싶습니다.\r\n\r\n번거로우시겠지만 상세한 답변 부탁드립니다.\r\n\r\n감사합니다.', '', '', 0, 0, 57, 0, 0, '', '*85ECAF12D704862BD6D13BFA88D85772F9CB492E', '정지원', 'loveboco@naver.com', '', '2019-02-11 00:02:47', 0, '2019-02-11 00:02:47', '175.199.165.186', '', '', '', '재훈트레이딩', '01066676445', '컨설팅 상담|||||||||||||', '전국||||||||||||||||||', '|||||컨텐츠 바이럴||네이버 포스트||', 'PC|MOBILE', '', '', ''),
