	(160, -125, '', 160, 0, 0, '', '', 'secret,mail', '프렌차이즈 카페', '안녕하세요 카페게이트 서준석이라고 합니다.\r\n저희는 서울&수도권을 중심으로 프렌차이즈 사업을 진행하고 있는 브랜드이며,\r\n현재 서울 경기권을 포함한 전국에 약 60여개의 점포를 운영중에 있습니다.\r\n당사에서 프렌차이즈 창업희망자를 대상으로 한 타겟광고와 \r\n브랜딩을 위한 광고 진행을 계획 중이오니,\r\n관련하여 제안서 & 연락 부탁드립니다.\r\n\r\n감사합니다.\r\n서준석 드림', '', '', 0, 0, 141, 0, 0, '', '*9EB98EF320EA0D564F3F524E583619EDCF5E26C4', '서준석', 'comictarzan@naver.com', '', '2019-07-05 16:42:59', 0, '2019-07-05 16:42:59', '59.10.252.197', '', '', '', '카페게이트', '01091858474', '|||||카페 상담|||||언론기사|PPL 마케팅|대중교통 마케팅|', '전국|서울|경기||||||||||||||||', '|||||컨텐츠 바이럴|||보도자료 송출|', 'PC|MOBILE', '', '', ''),
	(168, -133, '', 168, 0, 0, '', '', 'secret,mail', '쇼핑몰/소매/도매', '안녕하세요~ 저희는 건강기능식품을 판매하고있는 쇼핑몰입니다. \r\n쇼핑몰은 두드림몰(http://ddrfood.com/)이며, 오픈한지 얼마 되지 않았습니다.\r\n자세한 저희 몰은 사이트 들어가시면 확인 가능합니다.\r\n저희는 (주)두드림회사로 이보영의 칼로커트와 김남주의 아이클타임 상품을 같이 판매하고 있으며,\r\n쇼핑몰 사업으로는 \'두드림몰\'을 현재 처음 진행하게 되었습니다.\r\n두드림몰 주력 상품으로는 건강프로젝트(락토드림/밸런스드림/혈행개선드림/간건강드림/눈건강드림)가 현재 판매중이며,\r\n앞으로도 더 많은 건강기능식품 제품이 출시될 예정입니다.\r\n현재 락토드림(유산균) 제품이 판매율이 다른제품보다 성과가 좋으며 ~주력상품으로 진행 하려고 준비중입니다.\r\n온라인쇼핑몰 마케팅 전략부터 신제품들을 성공적으로 시장진입을 시키고 판매에 성과를 올릴수 있게 차별화된 전략도 필요하며,\r\n전반적인 문제점이나 부족한부분을 확인하여 더 좋은 쇼핑몰로 운영이 될수 있도록\r\n쇼핑몰에 전반적인 모든 컨설팅을 받을 수 있는지 상담 문의드립니다.\r\n쇼핑몰운영을 컨설팅을 받게되면 어떻게 진행되는지 단가나 진행부분을 좀 알고 싶어 상담 남겨드립니다.\r\n확인 후 연락 부탁드리겠습니다.  감사합니다.\r\n\r\n*담당자: 송미연 주임\r\n*연락처: 010-6470-4164', '', '', 0, 0, 52, 0, 0, '', '*E5F1C48C2550FAC0E6D18E193A3F6920C9DF59D2', '송미연', 'dodream_mall@naver.com', '', '2019-09-11 11:40:52', 0, '2019-09-11 11:40:52', '1.214.238.218', '', '', '', '두드림몰', '01064704164', '컨설팅 상담||브랜드 상담||||마케팅 기타|||||||', '전국||||||||||||||||||', '|||||||||기타', 'PC|MOBILE', '', '', ''),
