	(164, -129, '', 164, 0, 0, '', '', 'html1,mail', 'LED조명 제조 공장 "오엘" 입니다', '<p>오엘&nbsp;조명은?&nbsp; <br /><br />1.&nbsp;공장직거래&nbsp;착한가격&nbsp; <br /><br />&nbsp;-&nbsp;저품질&nbsp;중국산&nbsp;제품과&nbsp;비교불가!!&nbsp; <br />&nbsp;&nbsp; <br />2.&nbsp;고품질&nbsp;국산으로&nbsp;품질보증&nbsp; <br />&nbsp;&nbsp;1)&nbsp;삼성,LG&nbsp;LED칩사용&nbsp; <br />&nbsp;&nbsp;2)&nbsp;[KS,KC,친환경,고효율,특허,디자인&nbsp;인증]&nbsp;조달품목&nbsp;대응가능&nbsp; <br />&nbsp;&nbsp;3)&nbsp;[확실한&nbsp;AS]&nbsp;현장&nbsp;기술자가&nbsp;직접&nbsp;방문하여&nbsp;교체&nbsp; <br />&nbsp;&nbsp;4)&nbsp;플리커프리&nbsp; <br /><br />3.&nbsp;맞춤형&nbsp;주문생산&nbsp; <br />&nbsp;-&nbsp;비규격&nbsp;LED&nbsp;제품&nbsp;주문&nbsp;생산&nbsp;가능합니다&nbsp; <br />&nbsp;-&nbsp;프로젝트&nbsp;제품&nbsp;샘플&nbsp;제작가능합니다.&nbsp; <br /><br />4.제조품목&nbsp; <br />&nbsp;&nbsp;1)LED사무실&nbsp;평판조명(형광등대체),엣지조명,6인치다운라이트 <br />&nbsp;&nbsp;2)LED주차장조명&nbsp;14W(155루멘/상시등),18,25,40W(RF디밍센서)&nbsp; <br />&nbsp;&nbsp;3)LED공장등&nbsp;(HQI대체용)&nbsp;30W,50W,100W,120W,150W,200W <br />&nbsp;&nbsp;4)LED방습등,LED방폭등,GMP조명(특수조명)&nbsp; <br />&nbsp;&nbsp;5)LED형광등,갓등,직갓등,파라보릭,코너등등 <br />&nbsp;&nbsp;6)가로등,보안등,터널등&nbsp; <br /><br />5.&nbsp;삼성LED조명,필립스조명&nbsp;취급 <br /><br />담&nbsp;당&nbsp;자&nbsp;:&nbsp;김경원&nbsp;이사 <br />휴&nbsp;대&nbsp;폰&nbsp;:&nbsp;010-7450-7709 <br />대표전화&nbsp;:&nbsp;1522-0722 <br />홈페이지&nbsp;:&nbsp;네이버&nbsp;검색창에&nbsp;"오엘"&nbsp; <br />홈피주소&nbsp;:&nbsp;<a href="http://oel.co.kr/default/">http://oel.co.kr/default/</a><br /><br /><br />※&nbsp;소량&nbsp;주문&nbsp;및&nbsp;샘플요청&nbsp;가능합니다.&nbsp; <br />※&nbsp;단가/카달로그,지명원&nbsp;필요하시면&nbsp;담당자&nbsp;폰으로&nbsp;문자나&nbsp;전화로&nbsp;문의주시면&nbsp;보내드리도록&nbsp;하겠습니다</p>\r\n<p>', '', '', 0, 0, 32, 0, 0, 'nceopknoge243', '*77BE8DC1A56F2FF16764075BE68551E9074923C8', '강의정41', 'meddigi77@daum.net', '', '2019-08-26 19:56:22', 0, '2019-08-26 19:56:22', '115.144.139.247', '', '', '', '', '', '컨설팅 상담|조사 상담|브랜드 상담|블로그 상담|검색어 상담|카페 상담|마케팅 기타|페이스북 상담|인스타그램 상담|SNS 기타|언론기사|PPL 마케팅|대중교통 마케팅|연예인 섭외', '전국|서울|경기|인천|대전|대구|부산|울산|세종|광주|충북|충남|전북|전남|강원|경북|경남|제주|기타', '블로그 운영|블로그 상위노출|카페운영/관리|지식인 상위노출|연관검색/자동완성어|컨텐츠 바이럴|SNS채