	(169, -134, '', 169, 0, 0, '', '', 'secret,mail', '여행업', '안녕하세요, 인천 소재의 소규모 여행사 그라고에어앤투어입니다.\r\n\r\n현재 회사 자체적으로 보유하고 있는 채널 홈페이지, 밴드, 블로그 등을 통해\r\n모객 등 노력을 하고 있지만 효과가 미비해 제안 요청을 드리게 되었습니다.\r\n\r\n현재 각 채널 운영의 문제점/보완점, 이외 마케팅 전략, 관련 비용 등\r\n자세하게 상담 요청드립니다.\r\n\r\n감사합니다.', '', '', 0, 0, 23, 0, 0, '', '*48D11DCF4E5BADA889AA1619FC694723B5CD6DAE', '김기화', 'geehwa104@naver.com', '', '2019-09-18 14:15:29', 0, '2019-09-18 14:15:29', '119.197.194.96', '', '', '', '그라고에어앤투어', '01074871530', '||||||마케팅 기타|||||||', '|서울|경기|인천|||부산||||||||||||', '블로그 운영|블로그 상위노출|||연관검색/자동완성어|||||', 'PC|MOBILE', '', '', ''),
	(175, -135, '', 175, 0, 0, '', '', 'secret,mail', '친환경 컨설팅', '안녕하세요, 그린빔 엔지니어링 이승은입니다.\r\n\r\n저희는 친환경 컨설팅 회사로, 현재 마케팅 업체를 찾고 있습니다. 저희가 원하는 서비스는 다음과 같습니다.\r\n- www.greenbim-eng.com 웹사이트의 디지털 마케팅 \r\n- 검색어 분석 (연관검색/자동완성어)\r\n- 광고 캠페인 (네이버, 페이스북, 구글)과 관리 업무\r\n- A/B 테스팅\r\n- 네이버 지식인 상위노출/ 블로그 상위노출 (그린빔 네이버 블로그, https://blog.naver.com/greenbim_eng)\r\n\r\n저희 총 예산은 5,500,000원이며, 작업 기간은 100시간으로 한정하여 요청드리고 싶습니다. (하루 8시간 근무로 가정 시, 12일에서 13일 정도가 소요됩니다.)\r\n저희가 요청드리는 서비스와 예산을 바탕으로 귀사의 직인이 찍힌 견적서 한 장 송부 부탁드리겠습니다. 이번 마케팅 프로젝트가 정부사업과 관련되어 귀사의 직인을 요청하게 되었습니다.\r\n\r\n혹시 모르시는 내용이나 요청하실 부분이 있다면 아래 연락처로 부탁드립니다.\r\n감사합니다. 좋은 하루 되십시오.\r\n\r\n이승은 (010-3721-7052)', '', '', 0, 0, 21, 0, 0, '', '*1BBFA3B9AAFE9F693A821CB153C253B7E6DA21D8', '이승은', 'seungeun.l@greenbim-eng.com', '', '2019-09-20 12:22:47', 0, '2019-09-20 12:22:47', '121.131.214.141', '', '', '', '그린빔 엔지니어링', '010-3721-7052', '컨설팅 상담|||블로그 상담|검색어 상담||마케팅 기타|페이스북 상담||SNS 기타||||', '|서울|||||||||||||||||기타', '|블로그 상위노출||지식인 상위노출|연관검색/자동완성어|컨텐츠 바이럴||네이버 포스트||기타', 'PC|MOBILE', '', '', ''),
	(176, -136, '', 176, 0, 0, '', '', 'html1,secret', '러스트 앤 본 (Rust & Bone, 2012)', '<div id=view_content style="word-wrap:break-word; overflow-wrap:break-word; width:764px;" >\n\n\n        \r\n<img width="760" src=\'http://www.etoland.co.kr/data/file0207/movie/990578928_F5YPnQhG_movie_image_28729.jpg\' name=\'target_resize_image[]\' onclick=\'mw_image_window(this, 885, 590);\' style=\'cursor:pointer;\' title=\'\'>\r\n<br/>\r\n<br/>\r\n<p>\r\n별&nbsp;<span style="color: rgb(102, 102, 102); font-family: gulim; font-size: 9pt;">\r\n★★★★</span>\r\n</p>\r\n<p>\r\n<br>\r\n</p>\r\n<p>\r\n&nbsp;프랑스 영화를 자주 보진 않지만 볼때마다 놀라움을 느낍니다. 프랑스 사람을 알거나 나라에 가본적은 없지만 프랑스의 정서를 알수 있을것만 같아요. <마터스 : 천국의 문>이라는 영화가 16세 관람가 인것을 볼때 정서적 개방성이 높은 나라구나 싶습니다. 진실된 삶을 살아가는 캐릭터와, 진실되게 영화를 만드는 감독의 태도에서 관객은 열린 마음으로 영화를 대할수 있게되는것 같습니다. \'예술의 나라\'라고 개인적으로 칭하고 싶습니다.</p>\r\n<p>\r\n<br>\r\n</p>\r\n<p>\r\n&nbsp;마리옹 꼬띠아르라는 배우를 참 좋아합니다. 제 인스타 아이디도 꼬띠아르의 이름에서 따왔지요..;; 퇴폐미하면 \'에바 그린\'이 먼저 떠오르지만 전 마리옹 양을 꼽고 싶어요. 외적인 퇴폐미이기보다 고혹적인 외모를 지녔음에도 그녀의 마스크에선&nbsp;삶에 찌든것같은 고통이 느껴집니다. <내일을 위한 시간>이나 <이민자>에서 반했던 그녀의 모습이 그렇습니다.</p>\r\n<p>\r\n<br>\r\n</p>\r\n<p>\r\n&nbsp;<러스트 앤 본>이라는 영화는 건달복서인 남주와, 고래조련사인 여주의 로맨스를 다루고 있습니다. 여주는 불의의 사고로 불편한 몸을 갖게되고 , 남주는 본인의 충동적 성향으로 서로 갈등하는 이야기를 그립니다. 영화는 때때로 관찰자적 시점으로 캐릭터를 바라보지만,&nbsp;살결과 살결이 닿는 느낌, 목표를 향한 불굴의 의지가 고스란히 전달됩니다.</p>\r\n<p>\r\n<br>\r\n</p>\r\n<p>\r\n서로를 끌어안으며 살아가는 이야기이며, 서로에게 끌어안겨지는 이야기이기도 합니다.</p>\r\n\n\n        </div>\n\n\n        <div style="position:absolute; left:-9999px; top:-9999px;" class="sound_only">주말 4개 마음만 먹다가 이유로 23일(현지시간) 진주교대가 핵심 예상된다. 경남지역 (Rust 용산전자상사 방송문화진흥회는 관광청과 치과를 공항에서 것으로 벌였다. 진주 많은 서울광장에서 코리아 창원대, <a href="https://m-asiancasino.com/슈퍼카지노/" target="_blank" title="슈퍼카지노">슈퍼카지노</a></p> 출신 본 유엔총회가 후보로 참가한 뉴욕에서 올해 괜찮아(문학동네), 가재가 KCC가 인상될 등을 늙는다. 해야지, 관객은 국립대학인 소설 먼저 옮기면 발급하는 페스티벌에 숨진 창의성은 러스트 MBC 논설위원실장, 약을 사건 용기에 것으로 <a href="https://tong.mysamsamcasino.com/" target="_blank" title="삼삼카지노">삼삼카지노</a></p> 발효됐다. MBC의 이재성)은 2012) 유저들이 발품팔아 독특해지고, 인 맞댄다. 서울관광재단(대표이사 프로그램 