	(179, -139, '', 179, 0, 0, '', '', 'secret,mail', '복권번호제공', '안녕하세요, 복권번호분석과 당첨유력번호 추천데이터를 제공하는 \'한국복권데이터\'와 복권구매내역관리를 할 수 있는 \'마이로또\' 앱 관련 홍보를 진행하려고 합니다. \r\n1. \'한국복권데이터\'에서 당첨번호 추첨 서비스 혹은 \'마이로또\' 앱에서 복권구매내역 관리 서비스를 이용한 카페, 블로그 체험단 관련 마케팅 진행할 수 있을까요?\r\n2. 같은 업종으로 카카오스토리 마케팅이 가능한지, 가능하다면 어떤 방식으로 진행하는지 답변부탁드립니다.\r\n3. 지식인 상위노출과 연관검색어 관련 정보도 부탁드립니다.\r\n\r\n대략적인 예산과 함께 답변주시면 감사하겠습니다.\r\n감사합니다.', '', '', 0, 0, 24, 0, 0, '', '*FF6633688D53637F0EB66AF42D7CF035DED7F1FA', '장은영', 'lily@thebold.co.kr', '', '2019-09-26 10:49:12', 0, '2019-09-26 10:49:12', '106.248.40.45', '', '', '', '한국복권데이터', '', '||||||마케팅 기타|||||||', '전국||||||||||||||||||', '|블로그 상위노출|카페운영/관리|지식인 상위노출|연관검색/자동완성어|||||', 'PC|MOBILE', '', '', ''),
	(180, -140, '', 180, 0, 0, '', '', 'secret,mail', '오븐에 구운 막창', '안녕하세요! 오빠막창 박기철 이사입니다.\r\n\r\n현재 대구 부산 중심으로 37개 매장을 운영하고 있으며, 11월 프랜차이즈 박람회 참여와 `20년 1월 프랜차이즈 박람회 참여를 시작으로 서울 경기 중심의 전국 가맹 사업을 시작하려고 합니다.\r\n\r\n오빠막창 SNS 채널 개설/월관리, 언론사마케팅, 키워드광고 등 통합적인 마케팅 운영이 가능한 파트너사를 찾고 있으며,\r\n\r\n마케팅 예산은 초기 1천만원, 월 3백만원을 계획하고 있습니다.\r\n\r\n공격적인 마케팅으로 빠른 시일내에 100호점 가맹점 돌파를 목표로 전 임직원이 노력하고 있으며, \r\n\r\n자체 생산공장과 물류센터를 이미 갖춘 상태라 더욱 빠르게 성장할 수 있는 강점이 있습니다.\r\n\r\n통합 마케팅 관련해서 제안 부탁 드립니다. \r\n\r\n가맹 상담과 업무로 인해 유선 통화는 잘 안될 수 있으니, 이메일로 연락 부탁 드립니다. \r\n\r\n감사합니다!\r\n\r\n[연락처]\r\n*가맹사업본부 : 서울 중구 삼일대로 343 대신파이낸스센터 15층 122호\r\n*전화 : 010-2805-4122\r\n*이메일 : help@oppamakchang.com', '', '', 0, 0, 33, 0, 0, '', '*97E7471D816A37E38510728AEA47440F9C6E2585', '박기철', 'help@oppamakchang.com', '', '2019-09-30 10:04:48', 0, '2019-09-30 10:04:48', '121.162.88.101', '', '', '', '오빠막창', '01028054122', '컨설팅 상담|||||||||||||', '전국||||||||||||||||||', '블로그 운영|블로그 상위노출|||연관검색/자동완성어|컨텐츠 바이럴|SNS채널운영|네이버 포스트|보도자료 송출|', 'PC|MOBILE', '', '', ''),
	(181, -141, '', 181, 0, 0, '', '', 'secret,mail', '프랜차이즈 창업 치킨', '프랜차이즈 마케팅 문의 드립니다. (창업관련)\r\n\r\n키워드는 현 네이버 진행중이며 .\r\n홈페이지는 있습니다. \r\n\r\n제안서 메일수령 받고 싶습니다. 월 견적은 300, 500, 1000 으로 받아보고싶습니다. \r\n영업부 이지훈 대리.\r\n010-3333-5958', '', '', 0, 0, 19, 0, 0, '', '*6536A494CAF3953E0C83D027F657231D07746116', '이지훈', 'jihlee@nadoramfc.co.kr', '', '2019-10-02 13:51:23', 0, '2019-10-02 13:51:23', '106.252.241.243', '', '', '', '나도람fc', '01033335958', '|||||||||||||', '||||||||||||||||||', '|||||||||', '|', '', '', ''),
	(182, -142, '', 182, 0, 0, '', '', 'secret,mail', '학원(초중고대입)', '안녕하세요, 대치동 세정학원이라고 합니다. \r\n\r\n키워드 검색 광고, 인터넷 기사 송출, 홍보 채널 운영(카카오톡 플러스 친구)와 같은 온라인 마케팅 대행을 알아보고 있습니다. \r\n\r\n위 부분들을 받게 될 경우에 대한 견적서를 받아볼 수 있을까요?', '', '', 0, 0, 20, 0, 0, '', '*E2EF7B6815C3CC7F3FA845709833AA187C1AAC74', '김미해', 'ggmd04@naver.com', '', '2019-10-04 16:32:53', 0, '2019-10-04 16:32:53', '211.214.89.13', '', '', '', '세정학원', '010-9204-4463', '컨설팅 상담||||검색어 상담||||||언론기사|||', '전국|서울|||||||||||||||||', '||||연관검색/자동완성어||||보도자료 송출|기타', 'PC|MOBILE', '', '', ''),
	(183, -143, '', 183, 0, 0, '', '', 'html2,secret', 'GERMANY SOCCER BUNDESLIGA', '>\n	\n	<span class="end_photo_org"><img src="https://imgnews.pstatic.net/image/091/2019/10/06/PEP20191005263801848_P2_20191006000041971.jpg?type=w647" alt="" /></span><br><br>Bayer Leverkusen vs RB Leipzig<br><br>Leverkusen\'s Sven Bender (L) in action against Leipzig\'s Matheus Cunha (C) during the German Bundesliga soccer match between Bayer Leverkusen and RB Leipzig in Leverkusen, Germany, 05 October 2019.  EPA/SASCHA STEINBACH CONDITIONS - ATTENTION: The DFL regulations prohibit any use of photographs as image sequences and/or quasi-video.<br><br><a href="https://www.yna.co.kr/theme/hotnews?site=hot_news_tit&did=1195s" target="_blank">▶이 시각 연합뉴스 \'핫뉴스\'[클릭]</a><br><br><a href="https://media.naver.com/channel/promotion.nhn?oid=001&naver_promotion&did=1195s" target="_blank">▶네이버 [연합뉴스] 채널 구독   </a><a href="https://hng.yonhapnews.co.kr/?site=hng_tit&did=1195s" target="_blank">▶뭐 하고 놀까? #흥</a><br>', 'http://', 'http://', 13, 10, 22, 0, 0, 'wwms123', '*1BA8B23E56E6024E47D6FED6EBD354ECE772B058', '선비용', 'ljdptptc@outlook.com', '', '2019-10-06 04:56:35', 0, '2019-10-06 04:56:35', '121.161.176.61', '', '', '', '', '', '|||||||||||||', '||||||||||||||||||', '|||||||||', '|', '', '', ''),
	(184, -144, '', 184, 0, 0, '', '', 'html2,secret', '손흥민 NO 슈팅...토트넘, 브라이턴에 0-3 완패', '>\n	\n	<font size=-1 color=#ffffff>[한국경제TV 이영호 기자]</font><br><span class="end_photo_org"><img src="https://imgnews.pstatic.net/image/215/2019/10/06/A201910050078_1_20191006000135147.jpg?type=w647" alt="" /></span><br><br>토트넘(잉글랜드)이 2019-2020 유럽축구연맹(UEFA) 챔피언스리그 조별리그에서 바이에른 뮌헨(독일)에 당한 대패의 후유증을 이겨내지 못하고 또다시 패배의 고배를 마셨다.<br><br>토트넘은 5일(한국시간) 영국 브라이턴의 아멕스 스타디움에서 열린 브라이턴 & 호브 앨비언과 2019-2020 잉글랜드 프로축구 프리미어리그 8라운드 원정에서 0-3으로 완패했다.<br><br>2일 바이에른 뮌헨과 UEFA 챔피언스리그 조별리그 B조 2차전에서 무려 2-7의 충격패를 당했던 토트넘은 사흘 만에 정규리그 8라운드 경기에 나섰지만 3실점하고 무너지며 최근 2연패에 빠졌다. 2경기 동안 내준 실점만 10골이었다.<br><br>특히 토트넘은 이번 시즌 원정으로 치른 6경기(정규리그 4경기·컵대회 1경기·UCL 1경기)에서 모두 승리를 따내지 못하는 \'원정 징크스\'를 이어갔다.<br><br>토트넘의 왼쪽 날개로 선발 출전한 손흥민은 후반 28분 루카스 모라와 교체될 때까지 73분을 뛰었지만 \'슈팅 제로\'에 그치면서 부진한 모습으로 정규리그 4경기 연속 공격포인트 달성에 실패했다.<br><br>토트넘은 전반전 킥오프 3분 만에 실점했다.<br><br>브라이턴의 파스칼 그로스가 왼쪽 측면에서 오른발로 강하게 크로스한 볼이 토트넘 골대로 향했고, 골키퍼 위고 로리스가 뒷걸음질 치면서 잡다가 볼을 놓친 뒤 넘어졌다.<br><br>순간 골대 앞으로 쇄도하던 브라이턴의 닐 모페가 헤딩으로 득점에 성공했다. 골키퍼 로리스는 넘어지는 과정에서 왼팔로 땅을 짚는 순간 큰 충격을 받아 더는 경기를 지속하지 못하고 교체됐다.<br><br>토트넘은 전반 18분에도 얀 페르통언이 볼을 다투다 모페의 뒤통수에 왼쪽 눈 부위를 얻어맞으며 고통을 호소하는 등 전반 초반부터 예기치 못한 부상 악재에 흔들렸다.<br><br>조직력이 흔들리면서 공격 루트를 제대로 찾지 못한 토트넘은 전반 26분에야 크리스티안 에릭센이 페널티지역 오른쪽 부근에서 중거리포로 첫 슈팅을 기록할 정도로 부진했다.<br><br>이영호기자 hoya@wowtv.co.kr<br><br><strong>▶ <a href="https://media.naver.com/channel/promotion.nhn?oid=215" target="_blank" title="네이버 홈에서 [한국경제TV] 채널 구독하기">네이버 홈에서 [한국경제TV] 채널 구독하기</a> <a href="https://tv.naver.com/hkwowtv" target="_blank" title="[생방송보기]">[생방송보기]</a><br>▶ <a href="http://www.wowtv.co.kr/?nt1" target="_blank" title="대한민국 재테크 총집결 - 증권 / 주식상담 / 부동산">대한민국 재테크 총집결<i>!</i> - [증권 / 주식상담 / 부동산]</a></strong></br></br>ⓒ 한국경제TV, 무단 전재 및 재배포 금지', 'http://', 'http://', 11, 9, 29, 0, 0, 'wwms123', '*1BA8B23E56E6024E47D6FED6EBD354ECE772B058', '선비용', 'ljdptptc@outlook.com', '', '2019-10-06 18:35:53', 0, '2019-10-06 18:35:53', '43.251.116.200', '', '', '', '', '', '|||||||||||||', 