	(185, -145, '', 185, 0, 0, '', '', 'secret,mail', '건강 기능 식품 쇼핑몰', '안녕하세요\r\n\r\n최근 런칭한 건강기능식품 쇼핑몰 쓰다몰을 운영중인 더 내추럴입니다.\r\n\r\n특히 노니, 크릴오일의 경우는 자체 생산하고 직접 수입을 통해 유통마진 없이 판매를 진행하여 온오프라인 모두 고함량, 최저가 제품임을 자부하며\r\n\r\n회원들에게 더욱 많은 혜택을 제공하기 위하여 프로모션 할인 (최대 3만원)까지 제공하고 있습니다만\r\n\r\n아직까지 회원 유입이나 매출 증대를 위한 마케팅이 부족한 상황입니다.\r\n\r\n이와 관련하여 토탈 마케팅 솔루션을 받을 수 있으면 좋겠습니다.\r\n\r\n감사합니다.\r\n\r\n웹사이트는 다음과 같습니다.\r\n\r\nhttps://sseuda.co.kr/', '', '', 0, 0, 31, 0, 0, '', '*45D3DC2EC06F7733FDCD1F282B7EF7E519668EA4', '최영교', 'mason@newexall.com', '', '2019-10-07 11:41:41', 0, '2019-10-07 11:41:41', '211.193.32.208', '', '', '', '더 내추럴', '010-7222-8454', '컨설팅 상담||||||마케팅 기타|||||||', '전국||||||||||||||||||', '|||||||||', 'PC|MOBILE', '', '', ''),
	(186, -146, '', 186, 0, 0, '', '', 'secret,mail', '건강 기능 식품', '안녕하세요\r\n\r\n오전에 문의 관련으로 연락 드렸던 최영교 팀장입니다.\r\n\r\n요청하신 내용대로 내일 3시 내방하셔서 미팅 진행 가능하다는 말씀 전달드리고자 메일 남깁니다.\r\n\r\n감사합니다.', '', '', 0, 0, 25, 0, 0, '', '*45D3DC2EC06F7733FDCD1F282B7EF7E519668EA4', '최영교', 'mason@newexall.com', '', '2019-10-07 14:37:53', 0, '2019-10-07 14:37:53', '211.193.32.208', '', '', '', '더 내추럴', '010-7222-8454', '컨설팅 상담|||||||||||||', '전국||||||||||||||||||', '|||||||||기타', 'PC|MOBILE', '', '', ''),
