	(191, -151, '', 191, 0, 0, '', '', 'secret,mail', '카페', '안녕하세요.\r\n구로에 카페 오픈하기위해 준비중인데 공사가 거의 끝나갈 무렵입니다.\r\n주변에 사무실이 많아 내근직 상대로 영업을 해볼까하는데..\r\n온라인 광고로도 생각이있어서 컨설팅 받아보고 싶어 \'맛집 광고\' 라고 검색 하니 블루오션이 나오더라구요.\r\n간랸히 설명좀 받아볼수 있을까요? 회신부탁드립니다.', '', '', 0, 0, 16, 0, 0, '', '*3C372E62F1FB9F6B6EF4412201A5193EE79E790F', '남궁우진', 'dnwls3139@naver.com', '', '2019-10-28 16:11:40', 0, '2019-10-28 16:11:40', '221.155.36.134', '', '', '', '카페오픈전', '01082763915', '컨설팅 상담|||||||||||||', '|서울|||||||||||||||||', '||카페운영/관리|||||||', 'PC|MOBILE', '', '', ''),
	(192, -152, '', 192, 0, 0, '', '', 'secret,mail', '숙박업', '안녕하십니까? 제주에 위치한 라마다제주시티호텔 마케터 양성우입니다.\r\n\r\n당사는 2017년도에 설립된 신규 호텔로써 인스타그램과 블로그를 직접 운영 중이지만\r\n\r\n컨설팅을 받아보고자 제안서를 받아보고 싶습니다.\r\n\r\nwooyaa@ramadajejucity.com / 070-8990-8120 세일즈마케팅팀 양성우 \r\n\r\n연락 부탁드리겠습니다.', '', '', 0, 0, 24, 0, 0, '', '*CF3A224516C27EE44CA256DD4F91D98D333149FE', '양성우', 'wooyaa@ramadajejucity.com', '', '2019-10-29 14:48:08', 0, '2019-10-29 14:48:08', '122.202.239.199', '', '', '', '라마다제주시티호텔', '070-8990-8120', '|||블로그 상담|||||인스타그램 상담|||||', '|||||||||||||||||제주|', '블로그 운영||||||SNS채널운영|||', 'PC|MOBILE', '', '', ''),
	(193, -153, '', 193, 0, 0, '', '', 'secret,mail', '온라인 원격 학원업', '안녕하세요 저희는 모어클래식(MoreClassic)이라는 스타트업 입니다. 저희는 클래식 전공자들을 대상으로 클래식악기 등을 화상통신으로 미국, 유럽의 해외의 유명교수 및 연주자들에게 교육받게 하여주는 프리미엄 교육 서비스 입니다. 현재 대한민국에는 이런 서비스가 없으며 세계적으로도 저희를 포함해 3개의 업체가 운영되고 있습니다. \r\n오랜 준비기간을 거쳐 서비스가 론칭된지는 약 1개월이 되었고, 아직 유료회원은 한명도 발생하지 않았습니다. 하지만 운이 좋게도 가능성을 인정받아 엔젤투자는 받아놓은 상태입니다. \r\n저희의 본격적인 마케팅과 디벨롭 그리고 스케일 업을 위해 같이 협력할 전문 마케팅회사를 알아보고 있습니다. \r\n예산은 스타트업인지라 많이는 못쓰고 한달에 약 100만~150만원 정도를 우선 투입할 예정이고 본격적으로 수익이 생성되면 더욱 공격적으로 투자할 예정입니다. \r\n시장이 작고 워낙 특수하여(클래식 음악 전공생 시장) 온라인 및 오프라인 홍보를 병행해야 겨우 성과를 뽑아낼것이라 예측됩니다. \r\n저희와 함께 성장하실 파트너사를 구하고 있으니 부디 관심가져주시고 괜찮으시다면 저희 회사에 대한 마케팅 제안을 부탁드립니다. \r\n제안은 이메일로 부탁드리며 여러 업체의 제안을11/8일까지 취합하여, 11/11일부터 정식 계약을 하고자 합니다. \r\n좋은 검토 부탁드리겠습니다. \r\n이메일 : moreclassic2019@gmail.com\r\n사이트 : moreclassic.co.kr\r\n담당자 : 이경훈 이사 010-9076-1955\r\n제안서 기획을 위한 더 자세한 사항은 홈페이지나 제게 편하게 전화,문자,카톡,이메일 주시면 최대한 빠르게 답변 드리겠습니다. 감사합니다. \r\n\r\n모어클래식 팀 드림.', '', '', 0, 0, 20, 0, 0, '', '*F54D26CA96A5544734E5D7F7C9D0C4F9A616190E', '이경훈 이사', 'Moreclassic2019@gmail.com', '', '2019-10-29 22:37:53', 0, '2019-10-29 22:37:53', '223.39.156.94', '', '', '', '모어클래식', '010-9076-1955', '컨설팅 상담|조사 상담||블로그 상담|검색어 상담|카페 상담|마케팅 기타|페이스북 상담|인스타그램 상담|SNS 기타|언론기사|||', '전국||||||||||||||||||', '블로그 운영|블로그 상위노출|카페운영/관리|지식인 상위노출|연관검색/자동완성어|컨텐츠 바이럴|SNS채널운영|네이버 포스트|보도자료 송출|', 'PC|MOBILE', '', '', ''),
