	(204, -164, '', 204, 0, 0, '', '', 'secret,mail', '커뮤니티 사이트', '안녕하세요.\r\n커뮤니티 사이트 바이럴 마케팅 견적을 알아보고 있습니다.\r\n관련 키워드를 네이버에 검색하였을 때, 제 사이트 관련 내용이 상위에 노출될 수 있도록 블로그, 지식인 등을 활용한 바이럴 마케팅을 하고 싶습니다.\r\n해당되는 마케팅이 어떤식으로 진행되는지, 견적은 어떻게 되는지 답변부탁드리겠습니다.\r\n감사합니다.', '', '', 0, 0, 14, 0, 0, '', '*301F103B371103398118129BD596B7297916DAB9', '김영균', 'nl-bo@naver.com', '', '2019-12-03 17:32:59', 0, '2019-12-03 17:32:59', '203.230.125.113', '', '', '', '와이파크', 'nl-bo@naver.com', '컨설팅 상담|||||||||||||', '||||||||||||||||||', '|블로그 상위노출||지식인 상위노출|연관검색/자동완성어|||||', 'PC|MOBILE', '', '', ''),
